import React from 'react';
import { HashRouter as Router, Route, Redirect, Switch, withRouter } from "react-router-dom";
import { CSSTransition, TransitionGroup } from 'react-transition-group';

import Home from './Routes/Home';
import NetflixClone from './Routes/NetflixClone';
import NokchaStore from './Routes/NokchaStore';
import JavascriptProject from './Routes/JavascriptProject';

function App() {
  return (
    <Router>
      <TransitionGroup>
        <CSSTransition key={location.pathname} classNames="page-transition " timeout={1000}>
          <Switch location={location}>
            <Route exact path='/' component={Home} />
            <Route path='/NetflixClone' component={NetflixClone} />
            <Route path='/NokchaStore' component={NokchaStore} />
            <Route path='/JavascriptProject' component={JavascriptProject} />
            <Route component={() => <Redirect to='/' />} />
          </Switch>
        </CSSTransition>
      </TransitionGroup>
    </Router>
  );
}

export default withRouter(App);
